// original function taken from: https://stackoverflow.com/questions/5666222/3d-line-plane-intersection
function intersectsPlane(planePoint, planeNormal, linePoint, linePoint2) {

    let lineDirection = new THREE.Vector3(linePoint2.x - linePoint.x, linePoint2.y - linePoint.y, linePoint2.z - linePoint.z);
    let lineLength = lineDirection.length();
    lineDirection.normalize();

    if (planeNormal.dot(lineDirection) === 0) {
        return false;
    }

    let t = (planeNormal.dot(planePoint) - planeNormal.dot(linePoint)) / planeNormal.dot(lineDirection);
    if (t > lineLength) return false;
    if (t < 0) return false;



    let px = linePoint.x + lineDirection.x * t;
    let py = linePoint.y + lineDirection.y * t;
    let pz = linePoint.z + lineDirection.z * t;


    let planeSize = Infinity; 
    // if(nodes.length > 500) planeSize = 8;
    // if(nodes.length > 1000) planeSize = 5;
    // if(nodes.length > 2000) planeSize = 3;
    // if(nodes.length > 3500) planeSize = 1;
    if(vec3(planePoint.x - px, planePoint.y - py, planePoint.z - pz).length() > planeSize) return false;

    return vec3(px, py, pz);
}

// returns true iff the line from (a,b)->(c,d) intersects with (p,q)->(r,s)
// the original version of this function was taken from: 
// https://stackoverflow.com/questions/9043805/test-if-two-lines-intersect-javascript-function
function intersectsLine(a,b,c,d,p,q,r,s) {
    var det, gamma, lambda;
    det = (c - a) * (s - q) - (r - p) * (d - b);
    if (det === 0) {
        return false;
    } else {
        lambda = ((s - q) * (r - a) + (p - r) * (s - b)) / det;
        gamma = ((b - d) * (r - a) + (c - a) * (s - b)) / det;

        if((0 < lambda && lambda < 1) && (0 < gamma && gamma < 1)) {
            
            // let dir = new THREE.Vector2(c-a, d-b);
            // // dir.normalize();

            // let px = a + lambda * dir.x; 
            // let py = b + gamma  * dir.y;
            
            let dir1 = new THREE.Vector2(c-a, d-b);
            // dir1.normalize();
            let dir2 = new THREE.Vector2(r-p, s-q);
            // dir2.normalize();

            let px = (a + lambda * dir1.x); // + (p + gamma * dir2.x); 
            let py = (b + lambda * dir1.y); // + (q + gamma * dir2.y); 
            


            return { px: px, py: py };
        }

        return false;
    }
};

