function createVolumetricShaderPass() {
    shaderpassf = `
        uniform float uTime;
        uniform vec3 uResolution;
        uniform vec3 uCameraPosition;
        uniform vec4 uRandoms;
        uniform float uBokehStrength;

        varying vec2 vUv;

        float rand(vec2 p) {
        	vec3 p3  = fract(vec3(p.xyx) * .1031);
            p3 += dot(p3, p3.yzx + 33.33);
            return fract((p3.x + p3.y) * p3.z);
        }


        float mod289(float x){return x - floor(x * (1.0 / 289.0)) * 289.0;}
        vec4 mod289(vec4 x){return x - floor(x * (1.0 / 289.0)) * 289.0;}
        vec4 perm(vec4 x){return mod289(((x * 34.0) + 1.0) * x);}

        float noise(vec3 p){
            vec3 a = floor(p);
            vec3 d = p - a;
            d = d * d * (3.0 - 2.0 * d);

            vec4 b = a.xxyy + vec4(0.0, 1.0, 0.0, 1.0);
            vec4 k1 = perm(b.xyxy);
            vec4 k2 = perm(k1.xyxy + b.zzww);

            vec4 c = k2 + a.zzzz;
            vec4 k3 = perm(c);
            vec4 k4 = perm(c + 1.0);

            vec4 o1 = fract(k3 * (1.0 / 41.0));
            vec4 o2 = fract(k4 * (1.0 / 41.0));

            vec4 o3 = o2 * d.z + o1 * (1.0 - d.z);
            vec2 o4 = o3.yw * d.x + o3.xz * (1.0 - d.x);

            return o4.y * d.y + o4.x * (1.0 - d.y);
        }



        float intersectSphere(vec3 ro, vec3 rd, vec3 s0, float sr) {
            // sphere intersection test
            float result = -1.0;
        
            // - Returns distance from r0 to first intersecion with sphere,
            //   or -1.0 if no intersection.
        
            float a = dot(rd, rd);
            vec3 s0_r0 = ro - s0;
            float b = 2.0 * dot(rd, s0_r0);
            float c = dot(s0_r0, s0_r0) - (sr * sr);
            if (b*b - 4.0*a*c < 0.0) {
                result = -1.0;
            } else {
                result = (-b - sqrt((b*b) - 4.0*a*c))/(2.0*a);
            }
        
            return result;
        }


        void main() {
        
            // ****************** volumetrics attempt
            // ****************** volumetrics attempt
        
            vec3 cameraDir = normalize(-uCameraPosition);
            vec3 x = normalize(cross(cameraDir, vec3(0.0, 1.0, 0.0)));
            vec3 y = normalize(cross(x, cameraDir));
        
            vec2 ndc = vUv * 2.0 - 1.0;
            ndc.x *= uResolution.x / uResolution.y;
        
            float fov = 5.3;
        
            vec3 ro = uCameraPosition;
            vec3 rd = normalize(cameraDir * fov + x * ndc.x + y * ndc.y);
        
        
            float bs = min(uBokehStrength * 2.0, 0.12);
            bs = max(bs, 0.015);

            vec3  s0 = vec3(0.0, 0.0, 0.0);
            float sr = 15.0 + rand(uRandoms.xy * 100.0 + uTime + gl_FragCoord.xy) * 25.5 * bs;
            vec3 volumetricLightSourcePosition = vec3(30.0, 30.0, 0.0);
        
            float accumulatedLight = 0.0;
            float rr = 1.0;
        

            const int samples = 60;
            float smult = (60.0 / float(samples));

            for(int i = 0; i < samples; i++) {
            
                // vec3 rp = ro + rd * (85.0 + float(i) * 0.17 * 5.0 * smult);
                vec3 rp = ro + rd * (75.0 + float(i) * 0.17 * 6.75 * smult + uRandoms.x);

                // if(i < 60 && length(rp - volumetricLightSourcePosition) < 20.0) {
                //     gl_FragColor = vec4(1.0, 0.0, 0.0, 1.0);
                //     return;
                // }
            
                vec3 rprd = normalize(volumetricLightSourcePosition - rp);
                // float volumetricIntensity = noise(rprd * 22.0);

                // vec3 pp = volumetricLightSourcePosition + (-rprd * (volumetricLightSourcePosition.y / abs(rprd.y)));
                // float volumetricIntensity = noise(vec3(pp.xz * 0.2, 0.0));

                float volumetricIntensity = 0.0;
                float intRes = intersectSphere(rp, rprd, volumetricLightSourcePosition, 2.0);
                if(intRes > 0.0)
                    volumetricIntensity = // 1.0;
                        // pow(noise((rp + rprd * intRes) * 3.0), 2.0) +
                        pow(noise((rp + rprd * intRes) * 4.0), 1.0) * 0.8 +
                        pow(noise((rp + rprd * intRes) * 6.0), 15.0) * 3.5;


                // sphere intersection test
                float result = -1.0;
            
                // - Returns distance from r0 to first intersecion with sphere,
                //   or -1.0 if no intersection.
            
                float a = dot(rprd, rprd);
                vec3 s0_r0 = rp - s0;
                float b = 2.0 * dot(rprd, s0_r0);
                float c = dot(s0_r0, s0_r0) - (sr * sr);
                if (b*b - 4.0*a*c < 0.0) {
                    result = -1.0;
                } else {
                    result = (-b - sqrt((b*b) - 4.0*a*c))/(2.0*a);
                }
            
            
                if(result < 0.0 && length(rp) > sr) {
                    // no hit...
                    // accumulatedLight += 0.00035 * (1.0 / (pow(length(rp - volumetricLightSourcePosition) * 0.008, 3.0)));
                    // accumulatedLight += 0.00035 * (1.0 / (pow(length(rp - volumetricLightSourcePosition) * 0.008, 3.0))) * volumetricIntensity;
                    // accumulatedLight += 0.0005 * smult * (1.0 / (pow(length(rp - volumetricLightSourcePosition) * 0.008, 3.0))) * volumetricIntensity;
                    // accumulatedLight += 0.015 * smult * volumetricIntensity;

                    accumulatedLight += 0.0006 * smult * (1.0 / (pow(length(rp - volumetricLightSourcePosition) * 0.008, 3.0))) * volumetricIntensity;
                    // accumulatedLight += 0.00065 * smult * (1.0 / (pow(length(rp - volumetricLightSourcePosition) * 0.008, 3.23))) * volumetricIntensity;
                    // accumulatedLight += 0.0006 * smult * (1.0 / (pow(length(rp - volumetricLightSourcePosition) * 0.008, 3.23))) * volumetricIntensity;
                } else if (length(rp) < sr) {
                    accumulatedLight -= 0.0125 * pow(volumetricIntensity, 1.5);
                    // accumulatedLight -= 0.0175 * pow(volumetricIntensity, 1.5);
                } else {
                    accumulatedLight -= 0.003 * pow(volumetricIntensity, 1.5);
                    // accumulatedLight -= 0.004 * pow(volumetricIntensity, 1.5);
                }
            }
            // accumulatedLight *= rr;
            // accumulatedLight = max(accumulatedLight - 0.1, 0.0);
            accumulatedLight = max(accumulatedLight * 0.5, 0.0);
        

            // accumulatedLight *= 5.0;
            // accumulatedLight = accumulatedLight / (accumulatedLight + 1.0);


            // ****************** volumetrics attempt - END
            // ****************** volumetrics attempt - END
        
            gl_FragColor = vec4(vec3(accumulatedLight), 1.0);
        }`;
}

function smoothstepAnim(from, to, animStart, animEnd, animCurrent) {
    if(animCurrent > animEnd) animCurrent = animEnd;

    let t = (animCurrent - animStart) / (animEnd - animStart);
    t = t * t * (3.0 - 2.0 * t);
    let delta = to - from;

    return from + delta * t;
}

function smoothstep(t) {
    return t * t * (3.0 - 2.0 * t);
}

